import React from "react";
import "./home.css";
import Navigation from "../Navigation";
import landscape from "../../img/landscape-home.png";

const Home = () => {
    return (
            <div className="main-home">
                <img className="home-landscape" alt="home-landscape" src={landscape}/>
            </div>   
    )
}

export default Home;
